const fontChunks = [];

fontChunks.push(
  new FontFace(
    'Dank Mono',
    'url(data:application/font-woff;charset=utf-8;base64,)',
    {
      style: 'normal',
      weight: 'normal',
      unicodeRange: 'U+0000-007F',
    },
  ),
);

fontChunks.push(
  new FontFace(
    'Dank Mono',
    'url(data:application/font-woff;charset=utf-8;base64,)',
    {
      style: 'normal',
      weight: 'normal',
      unicodeRange: 'U+0080-1AFF',
    },
  ),
);

fontChunks.push(
  new FontFace(
    'Dank Mono',
    'url(data:application/font-woff;charset=utf-8;base64,)',
    {
      style: 'normal',
      weight: 'normal',
      unicodeRange: 'U+1B00-218F',
    },
  ),
);

fontChunks.push(
  new FontFace(
    'Dank Mono',
    'url(data:application/font-woff;charset=utf-8;base64,)',
    {
      style: 'normal',
      weight: 'normal',
      unicodeRange: 'U+2190-21FF',
    },
  ),
);

fontChunks.push(
  new FontFace(
    'Dank Mono',
    'url(data:application/font-woff;charset=utf-8;base64,)',
    {
      style: 'normal',
      weight: 'normal',
      unicodeRange: 'U+2200-10FFFF',
    },
  ),
);

const loadFonts = async () => {
  const fontChunksPromises = fontChunks.map((font) => font.load());
  await Promise.all(fontChunksPromises);
  fontChunks.forEach((font) => document.fonts.add(font));
  document.body.style.fontFamily = 'Dank Mono, sans-serif';
};
loadFonts();
